def Skew(sequence):
    answ = []
    c_counter = 0
    g_counter = 0
    min_diff = 0
    curr_diff = 0
    for i, word in enumerate(sequence):
        if word == 'G':
            g_counter+=1
        if word == 'C':
            c_counter+=1

        curr_diff = g_counter - c_counter

        if  curr_diff < min_diff:
            min_diff = curr_diff
            answ = []
            answ.append(i+1)
        elif curr_diff == min_diff:
            answ.append(i+1)

    return answ
sequence = ''
print(' '.join(map(str, Skew(sequence))))